from collections import defaultdict

class Solution:
    def wordSubsets(self, A, B):
        """
        :type A: List[str]
        :type B: List[str]
        :rtype: List[str]
        """
        bCounts = defaultdict(int)
        for word in B:
            counts = self.getCharCounts(word)
            for k, v in counts.items():
                bCounts[k] = max(bCounts[k], v)
        ret = []
        for word in A:
            aCounts = self.getCharCounts(word)
            aIsUniversal = True
            for k, v in bCounts.items():
                if aCounts[k] < bCounts[k]:
                    aIsUniversal = False
                    break
            if aIsUniversal:
                ret.append(word)
        return ret

    def getCharCounts(self, word):
        counts = defaultdict(int)
        for ch in word:
            counts[ch] += 1
        return counts

